import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Importing necessary routing components
import Visualizer from './Visualizer'; // Import the Visualizer component

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Define the route for the main page */}
          <Route path="/" element={
            <div className="welcome-screen">
              <h1>Welcome</h1>
              <button onClick={() => window.location.href = '/visualizer'}>Go to Visualizer</button>
            </div>
          } />

          {/* Define the route for the Visualizer page */}
          <Route path="/visualizer" element={<Visualizer />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
